import React from "react";
import GlobalStyle from "../../styles/Global.css";
import { useNavigate } from "react-router";

const { SideBar } = GlobalStyle

function SideBarComp() {

    const navigate = useNavigate()

    return (
        <>
            <SideBar>
                <button onClick={() => {navigate("/Account")}} style={{ marginBottom: "30px" }}><img src="https://img.icons8.com/?size=256&id=95101&format=png" alt="Личный кабинет" /></button>
                <button onClick={() => {navigate("/Asses")}} style={{ marginBottom: "auto" }} icon="pi pi-check" aria-label="Filter"><img src="https://img.icons8.com/?size=256&id=NjzqV0aREXb6&format=png" alt="Знакомства" /></button>
                <button onClick={() => {navigate("/Asses")}} icon="pi pi-check" aria-label="Filter"><img src="https://img.icons8.com/?size=256&id=T9nkeADgD3z6&format=png" alt="Выйти" /></button>
            </SideBar>
        </>
    )
}

export default SideBarComp
